// @description  四川大学综合教务系统助手，是一个优化四川大学综合教务系统的「Userscript」，即用户脚本。这不是一个独立的软件，也不是一个浏览器的插件，但可以依赖浏览器的插件运行，或者作为一个Bookmarklet在点击后运行。该脚本可以为综合教务系统增加以下功能：1. 外观美化：会自动美化教务系统界面上部分元素的外观；2. 快捷评教：自动为「希望给好评」的老师打满分好评，并附上随机的正面评语；3. 自动登录：恢复登陆页面的「两周之内不必登录」选项，每次打开教务系统后不用重复登录；4. 均分绩点计算器：可以直接看到自己的全部均分、全部绩点与必修均分、必修绩点，还可以自由选择自己需要的课程进行计算，甚至可以方便地对预期成绩进行估计；5. 培养方案查询：可以方便地查询全校所有专业的培养方案与指导性教学计划，并且可以选择任意两个培养方案进行比较，查看差异，还能将查询结果保存为长图；6. 本学期成绩查询：可以方便地查询到本学期课程成绩的最高分、最低分、平均分和名次；7. 分项成绩查询：可以方便地查询到部分课程成绩的分项成绩，了解自己成绩的具体组成情况；8. 历年大创查询：可以查询川大历年立项的大创项目信息；9. 专业授位查询：可以查询专业的学士学位授位情况。
